import React from 'react';

const NavBar = () => {
  return (
    <nav className='navbar navbar-dark bg-dark'>
      <ul className='nav mr-auto'>
        <li className='nav-item'>
          <div className='nav-tabs'>
            <a href='#' className='nav-link'>
              Home
            </a>
          </div>
        </li>
        <li className='nav-item'>
          <a href='#' className='nav-link'>
            about
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
